import { Container } from "./style"

interface FormBoxProps {
    children: ReactNode,
    isEmailInvalid?: boolean
}
export const FormBox = ({children, isEmailInvalid}: FormBoxProps) => {
    return (
        <Container isEmailInvalid={isEmailInvalid}>
            {
                children
            }
        </Container>
    )
}
